import React from 'react';
import './wel.css';
function Home() {
    return (
        <div className="welcome-container">
            <div className="photo">
            </div>
            <div className="content">
                <h1>Get Started</h1>
                <div className="content-title">
                Title
                </div>
            </div>
            <div className="footer">
                <h1>Get Started</h1>
            </div>
        </div>
    );
}

export default Home;
